import React, { 
  Component,
  Fragment
} 
from 'react';

import {
  Button,
  Grid,
  Range,
  TgButton,
  SoundViewer
}
from "./components";

class App extends Component {
  render() {
    return (
    <div className="jumbotron" style={{width: "100%", maxWidth: "60rem"}}>
        <Grid columns={1}>
          <Grid columns={2}>
            <TgButton/>
            <TgButton/>
          </Grid>
          <Range/>
          <SoundViewer name="asdasd"/>
        </Grid>

        <Grid>
          <Button name="q"/>
          <Button name="w"/>
          <Button name="e"/>

          <Button name="a"/>
          <Button name="s"/>
          <Button name="d"/>

          <Button name="z"/>
          <Button name="x"/>
          <Button name="c"/>
        </Grid>
      </div>
    );
  }
}

export default App;
